import { Row, Col } from "react-bootstrap";

function Film() {
    return (
        <Row>
            <Col>{this.props.Id}</Col>
            <Col>{this.props.Title}</Col>
            <Col>{this.props.AvgGrade}</Col>
        </Row>
    )
}

export default Film;
